import React, { useEffect } from 'react';
import { useRouter } from 'next/router';

export default function App() {
  const router = useRouter();
  const user = localStorage.user;

  useEffect(() => {
    if (user) {
      router.push('/dashboard');
    }
  }, []);

  return (
    <h1>FUCK YOU!</h1>
  );
};
